    "# Prediction Function\n",
    "This function predicts class labels for given inputs using the trained neural network.\n",
    "\n",
    "1. **Input Parameters**:  \n",
    "   - `X`: Input feature matrix.  \n",
    "   - `W1, b1, W2, b2`: Current weights and biases of the network.  \n",
    "\n",
