    "   - Performs a forward pass through the network to get predicted probabilities (`A2`).  \n",
    "   - Converts probabilities to binary class labels using a threshold of 0.5 (`>0.5  1`, otherwise `0`).  \n",
    "\n",
    "3. **Returns**:  \n",
    "   - Predicted class labels (0 or 1) for each sample.\n"
